import React from 'react';
import styled from 'styled-components';

const FullScreenContainer = styled.div`
  width: 100vw;
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: #f0f0f0;
`;

function App() {
  return (
    <FullScreenContainer>
      <h1>Hello, World!</h1>
    </FullScreenContainer>
  );
}

export default App;
